// transpose returns a transposed version of the two-dimensional slice.
func transpose(data [][]string) [][]string {
	if len(data) == 0 {
		return nil
	}
	var (
		height = len(data)
		width  = len(data[0])
	)
	result := make([][]string, width)
	for x := 0; x < width; x++ {
		column := make([]string, height)
		for y := 0; y < height; y++ {
			column[y] = data[y][x]
		}
		result[x] = column
	}
	return result
}
